INSERT INTO `cms_article` VALUES ('20', 'blue', '<pre class=\"brush:java;toolbar:false;\">package&nbsp;org.guess.security.controller;\r\n\r\nimport&nbsp;javax.servlet.http.HttpServletRequest;\r\nimport&nbsp;javax.servlet.http.HttpSession;\r\n\r\nimport&nbsp;org.apache.shiro.SecurityUtils;\r\nimport&nbsp;org.apache.shiro.authc.AuthenticationException;\r\nimport&nbsp;org.apache.shiro.authc.ExcessiveAttemptsException;\r\nimport&nbsp;org.apache.shiro.authc.IncorrectCredentialsException;\r\nimport&nbsp;org.apache.shiro.authc.LockedAccountException;\r\nimport&nbsp;org.apache.shiro.authc.UnknownAccountException;\r\nimport&nbsp;org.apache.shiro.authc.UsernamePasswordToken;\r\nimport&nbsp;org.apache.shiro.subject.Subject;\r\nimport&nbsp;org.guess.core.Constants;\r\nimport&nbsp;org.guess.core.utils.security.Coder;\r\nimport&nbsp;org.guess.sys.model.Log;\r\nimport&nbsp;org.guess.sys.model.User;\r\nimport&nbsp;org.guess.sys.service.LogService;\r\nimport&nbsp;org.guess.sys.service.UserService;\r\nimport&nbsp;org.springframework.beans.factory.annotation.Autowired;\r\nimport&nbsp;org.springframework.stereotype.Controller;\r\nimport&nbsp;org.springframework.web.bind.annotation.RequestMapping;\r\nimport&nbsp;org.springframework.web.bind.annotation.RequestMethod;\r\nimport&nbsp;org.springframework.web.bind.annotation.RequestParam;\r\nimport&nbsp;org.springframework.web.servlet.view.InternalResourceViewResolver;\r\n\r\n@Controller\r\n@RequestMapping(&quot;/&quot;)\r\npublic&nbsp;class&nbsp;LoginController&nbsp;{\r\n	\r\n	@Autowired\r\n	private&nbsp;HttpSession&nbsp;session;\r\n	\r\n	@Autowired\r\n	private&nbsp;LogService&nbsp;logService;\r\n	\r\n	@Autowired\r\n	private&nbsp;UserService&nbsp;userService;\r\n	\r\n	@RequestMapping(method&nbsp;=&nbsp;RequestMethod.GET)\r\n	public&nbsp;String&nbsp;index()&nbsp;{\r\n		System.out.println(&quot;index&quot;);\r\n		return&nbsp;&quot;login&quot;;\r\n	}\r\n\r\n	@RequestMapping(method&nbsp;=&nbsp;RequestMethod.GET,value=&quot;/login&quot;)\r\n	public&nbsp;String&nbsp;login()&nbsp;{\r\n		/*Object&nbsp;object&nbsp;=&nbsp;session.getAttribute(Constants.CURRENT_USER);\r\n		System.out.println(object);*/\r\n		return&nbsp;&quot;login&quot;;\r\n	}\r\n\r\n	@RequestMapping(method&nbsp;=&nbsp;RequestMethod.POST,value=&quot;login&quot;)\r\n	public&nbsp;String&nbsp;login(@RequestParam(&quot;userName&quot;)&nbsp;String&nbsp;userName,&nbsp;@RequestParam(&quot;password&quot;)&nbsp;String&nbsp;password,\r\n			@RequestParam(value=&quot;rememberMe&quot;,required=false,defaultValue=&quot;false&quot;)&nbsp;boolean&nbsp;remember,HttpServletRequest&nbsp;request)&nbsp;{\r\n\r\n		UsernamePasswordToken&nbsp;token&nbsp;=&nbsp;new&nbsp;UsernamePasswordToken(userName,&nbsp;Coder.encryptMD5(userName+password));\r\n		token.setRememberMe(remember);\r\n		Subject&nbsp;currentUser&nbsp;=&nbsp;SecurityUtils.getSubject();\r\n		try&nbsp;{\r\n			currentUser.login(token);\r\n		}&nbsp;catch&nbsp;(UnknownAccountException&nbsp;uae)&nbsp;{\r\n			System.out.println(&quot;对用户[&quot;&nbsp;+&nbsp;userName&nbsp;+&nbsp;&quot;]进行登录验证..验证未通过,未知账户&quot;);\r\n			request.setAttribute(&quot;message_login&quot;,&nbsp;&quot;未知账户&quot;);\r\n		}&nbsp;catch&nbsp;(IncorrectCredentialsException&nbsp;ice)&nbsp;{\r\n			System.out.println(&quot;对用户[&quot;&nbsp;+&nbsp;userName&nbsp;+&nbsp;&quot;]进行登录验证..验证未通过,错误的凭证&quot;);\r\n			request.setAttribute(&quot;message_login&quot;,&nbsp;&quot;密码不正确&quot;);\r\n		}&nbsp;catch&nbsp;(LockedAccountException&nbsp;lae)&nbsp;{\r\n			System.out.println(&quot;对用户[&quot;&nbsp;+&nbsp;userName&nbsp;+&nbsp;&quot;]进行登录验证..验证未通过,账户已锁定&quot;);\r\n			request.setAttribute(&quot;message_login&quot;,&nbsp;&quot;账户已锁定&quot;);\r\n		}&nbsp;catch&nbsp;(ExcessiveAttemptsException&nbsp;eae)&nbsp;{\r\n			System.out.println(&quot;对用户[&quot;&nbsp;+&nbsp;userName&nbsp;+&nbsp;&quot;]进行登录验证..验证未通过,错误次数过多&quot;);\r\n			request.setAttribute(&quot;message_login&quot;,&nbsp;&quot;用户名或密码错误次数过多&quot;);\r\n		}&nbsp;catch&nbsp;(AuthenticationException&nbsp;ae)&nbsp;{\r\n			//&nbsp;通过处理Shiro的运行时AuthenticationException就可以控制用户登录失败或密码错误时的情景\r\n			System.out.println(&quot;对用户[&quot;&nbsp;+&nbsp;userName&nbsp;+&nbsp;&quot;]进行登录验证..验证未通过,堆栈轨迹如下&quot;);\r\n			ae.printStackTrace();\r\n			request.setAttribute(&quot;message_login&quot;,&nbsp;&quot;用户名或密码不正确&quot;);\r\n		}\r\n		//&nbsp;验证是否登录成功\r\n		if&nbsp;(currentUser.isAuthenticated())&nbsp;{\r\n			try&nbsp;{\r\n				User&nbsp;curUser&nbsp;=&nbsp;userService.findByLoginId(userName);\r\n				logService.save(new&nbsp;Log(&quot;系统登录&quot;,&nbsp;1,&nbsp;&quot;登录系统&quot;,&nbsp;curUser,request.getRemoteAddr()));\r\n			}&nbsp;catch&nbsp;(Exception&nbsp;e)&nbsp;{\r\n				e.printStackTrace();\r\n			}\r\n			return&nbsp;&quot;redirect:/sys/user/list&quot;;\r\n		}&nbsp;else&nbsp;{\r\n			token.clear();\r\n		}\r\n		return&nbsp;&quot;/login&quot;;\r\n	}\r\n	\r\n	/**\r\n	&nbsp;*&nbsp;用户登出\r\n	&nbsp;*/\r\n	@RequestMapping(&quot;/logout&quot;)\r\n	public&nbsp;String&nbsp;logout(HttpServletRequest&nbsp;request)&nbsp;{\r\n		User&nbsp;curUser&nbsp;=&nbsp;(User)&nbsp;session.getAttribute(Constants.CURRENT_USER);\r\n		SecurityUtils.getSubject().logout();\r\n		try&nbsp;{\r\n			logService.save(new&nbsp;Log(&quot;系统登出&quot;,&nbsp;1,&nbsp;&quot;退出系统&quot;,&nbsp;curUser,request.getRemoteAddr()));\r\n		}&nbsp;catch&nbsp;(Exception&nbsp;e)&nbsp;{\r\n			e.printStackTrace();\r\n		}\r\n		return&nbsp;InternalResourceViewResolver.REDIRECT_URL_PREFIX&nbsp;+&nbsp;&quot;/login&quot;;\r\n	}\r\n}</pre><p><br/></p>', '2014-05-01', '', null, null, '1', '', 't4-添加代码', null, null, '7');
INSERT INTO `cms_article` VALUES ('21', 'red', '<h1 label=\"标题居中\" style=\"font-size: 32px; font-weight: bold; border-bottom-color: rgb(204, 204, 204); border-bottom-width: 2px; border-bottom-style: solid; padding: 0px 4px 0px 0px; text-align: center; margin: 0px 0px 20px;\"><span style=\"text-decoration: none; color: rgb(255, 0, 0);\">log4j.appender.RollingFile.layout.ConversionPattern</span></h1><p><br/></p>', '2014-05-01', '', null, null, '1', '', 't8', null, null, '7');
INSERT INTO `cms_article` VALUES ('25', 'green', '<p style=\"color: rgb(109, 109, 109); font-family: Arial; font-size: 12px; line-height: 21.600000381469727px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 14px;\">&nbsp;&nbsp;&nbsp;</span><span style=\"font-size: 14px;\">数字空间所研发的地震灾情快速评估系统是基于公里格网化数据进行计算的，从计算数据精度、地震影响场生成模型及灾情评估模型等方面做了极大优化，确保计算结果的高精度。系统满足各级地震局在震后第一时间，快速得到人员伤亡、经济损失、建筑物破坏状态等灾情评估要求，自动生成灾情报告以便向上级单位进行汇报。</span></p><p style=\"color: rgb(109, 109, 109); font-family: Arial; font-size: 12px; line-height: 21.600000381469727px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 14px;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"font-size: 14px;\">传统以行政区划为单元的评估方式中存在着误差较大的问题,分析其原因主要是：地震烈度横跨行政区，而评估时采用行政区(如区县)的平均人口分布数粒度偏大。本系统针对以上问题提出了较为先进、成熟的公里格网分布技术，对参与评估的基础数据进行精度提升。另一方面，通过与地震行业专家沟通，对评估模型进行了改进，并结合汶川地震、玉树地震和芦山地震所反映出的问题，对模型进行了极大的修正。通过已发生地震对本系统的检验，系统评估结果的准确性已完全达到快速评估阶段要求，得到了用户的一致好评。</span></p><p style=\"color: rgb(109, 109, 109); font-family: Arial; font-size: 12px; line-height: 21.600000381469727px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 16px;\"><strong>1、地震烈度影响场计算模块</strong></span></p><p style=\"color: rgb(109, 109, 109); font-family: Arial; font-size: 12px; line-height: 21.600000381469727px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 14px;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 在地震发生后，根据地震四要素及点源/线源衰减模型快速判定地震影响范围，并自动勾画出地震烈度影响场。地震的破裂方向通过震中周边的活动构造情况自动判断，并可基于专家经验进行手动调整。</span></p><p style=\"color: rgb(109, 109, 109); font-family: Arial; font-size: 12px; line-height: 21.600000381469727px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 14px;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 根据地震现场反馈回的动态评估信息，提供影响场调整接口，对影响场范围进行不断的修正，使之逼近真实。影响场修改方面，提供影响场的生成、修改、拖拽、旋转、平滑等工具，并可根据实际情况增加飞地等要素。</span></p>', '2014-05-02', '', null, null, '1', '', '基于公里格网数据的', null, null, '7');
INSERT INTO `cms_article` VALUES ('26', 'orange', '<p><br/></p><p style=\"margin: 10px auto; padding: 0px; color: rgb(51, 51, 51); font-family: verdana, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 25.200000762939453px; white-space: normal; background-color: rgb(255, 255, 255);\">如题。</p><p style=\"margin: 10px auto; padding: 0px; color: rgb(51, 51, 51); font-family: verdana, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 25.200000762939453px; white-space: normal; background-color: rgb(255, 255, 255);\">&nbsp; &nbsp; &nbsp; &nbsp; 最近需要使用到网页后台富文本编辑器。经过同学推荐，最后决定使用百度家的Ueditor.</p><p style=\"margin: 10px auto; padding: 0px; color: rgb(51, 51, 51); font-family: verdana, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 25.200000762939453px; white-space: normal; background-color: rgb(255, 255, 255);\">官方地址：<a href=\"http://ueditor.baidu.com/website/\" target=\"_blank\" style=\"margin: 0px; padding: 0px; text-decoration: none; color: rgb(0, 0, 0); border-bottom-width: 1px; border-bottom-style: dotted; border-bottom-color: rgb(51, 51, 51);\">http://ueditor.baidu.com/website/</a></p><p style=\"margin: 10px auto; padding: 0px; color: rgb(51, 51, 51); font-family: verdana, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 25.200000762939453px; white-space: normal; background-color: rgb(255, 255, 255);\">贴吧地址：<a class=\"card_title_fname\" href=\"http://tieba.baidu.com/f?kw=ueditor%CC%D6%C2%DB\" target=\"_blank\" style=\"margin: 0px; padding: 0px; text-decoration: none; color: rgb(0, 0, 0); border-bottom-width: 1px; border-bottom-style: dotted; border-bottom-color: rgb(51, 51, 51);\"><span style=\"margin: 0px; padding: 0px; line-height: 1.8;\">ueditor讨论吧</span></a></p><p style=\"margin: 10px auto; padding: 0px; color: rgb(51, 51, 51); font-family: verdana, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 25.200000762939453px; white-space: normal; background-color: rgb(255, 255, 255);\">官方提供了网页上非常方便的自定义工具栏的功能。自定义之后直接下载对应的代码包并按照文档部署到项目中即可。其中主要的问题是路径的配置。</p><p style=\"margin: 10px auto; padding: 0px; color: rgb(51, 51, 51); font-family: verdana, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 25.200000762939453px; white-space: normal; background-color: rgb(255, 255, 255);\">首先是将下载好的代码包发布到我们项目的根目录下面。然后在需要添加富文本编辑器的页面头部添加如下代码：</p><p style=\"margin: 10px auto; padding: 0px; color: rgb(51, 51, 51); font-family: verdana, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 25.200000762939453px; white-space: normal; background-color: rgb(255, 255, 255);\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p><p><strong style=\"margin: 0px; padding: 0px;\">[javascript]</strong>&nbsp;<a class=\"ViewSource\" title=\"view plain\" href=\"http://blog.csdn.net/killzero/article/details/16939309\" style=\"margin: 0px 10px 0px 0px; padding: 0px; text-decoration: none; color: rgb(160, 160, 160); background-image: none; background-color: inherit; border-style: none none dotted; border-bottom-width: 1px; border-bottom-color: rgb(51, 51, 51); font-size: 9px; background-position: initial initial; background-repeat: initial initial;\">view plain</a><a class=\"CopyToClipboard\" title=\"copy\" href=\"http://blog.csdn.net/killzero/article/details/16939309\" style=\"margin: 0px 10px 0px 0px; padding: 0px; text-decoration: none; color: rgb(160, 160, 160); background-image: none; background-color: inherit; border-style: none none dotted; border-bottom-width: 1px; border-bottom-color: rgb(51, 51, 51); font-size: 9px; background-position: initial initial; background-repeat: initial initial;\">copy</a><a class=\"PrintSource\" title=\"print\" href=\"http://blog.csdn.net/killzero/article/details/16939309\" style=\"margin: 0px 10px 0px 0px; padding: 0px; text-decoration: none; color: rgb(160, 160, 160); background-image: none; background-color: inherit; border-style: none none dotted; border-bottom-width: 1px; border-bottom-color: rgb(51, 51, 51); font-size: 9px; background-position: initial initial; background-repeat: initial initial;\">print</a><a class=\"About\" title=\"?\" href=\"http://blog.csdn.net/killzero/article/details/16939309\" style=\"margin: 0px 10px 0px 0px; padding: 0px; text-decoration: none; color: rgb(160, 160, 160); background-image: none; background-color: inherit; border-style: none none dotted; border-bottom-width: 1px; border-bottom-color: rgb(51, 51, 51); font-size: 9px; background-position: initial initial; background-repeat: initial initial;\">?</a><a title=\"在CODE上查看代码片\" href=\"https://code.csdn.net/snippets/80398\" target=\"_blank\" style=\"margin: 0px 10px 0px 0px; padding: 0px; text-decoration: none; color: rgb(160, 160, 160); background-image: none; background-color: inherit; border-style: none none dotted; border-bottom-width: 1px; border-bottom-color: rgb(51, 51, 51); font-size: 9px; background-position: initial initial; background-repeat: initial initial;\"><img src=\"https://code.csdn.net/assets/CODE_ico.png\" alt=\"在CODE上查看代码片\" width=\"12\" height=\"12\" style=\"margin: 0px; padding: 0px; border: 0px;\"/></a><a title=\"派生到我的代码片\" href=\"https://code.csdn.net/snippets/80398/fork\" target=\"_blank\" style=\"margin: 0px 10px 0px 0px; padding: 0px; text-decoration: none; color: rgb(160, 160, 160); background-image: none; background-color: inherit; border-style: none none dotted; border-bottom-width: 1px; border-bottom-color: rgb(51, 51, 51); font-size: 9px; background-position: initial initial; background-repeat: initial initial;\"><img src=\"https://code.csdn.net/assets/ico_fork.svg\" alt=\"派生到我的代码片\" width=\"12\" height=\"12\" style=\"margin: 0px; padding: 0px; border: 0px;\"/></a></p><ol class=\"dp-c list-paddingleft-2\" start=\"1\" style=\"padding: 0px 0px 0px 50px; border: none; list-style-position: initial; list-style-image: initial; background-color: rgb(255, 255, 255); color: rgb(92, 92, 92); margin-bottom: 1px !important; margin-left: 45px !important;\"><li><p><span style=\"margin: 0px; padding: 0px; line-height: 1.8; border: none; col