; background-color: inherit;\">&quot;white-space:pre&quot;</span><span style=\"margin: 0px; padding: 0px; line-height: 1.8; border: none; background-color: inherit;\">&gt;&nbsp;&nbsp;&lt;/span&gt;window.UEDITOR_HOME_URL&nbsp;=&nbsp;</span><span class=\"string\" style=\"margin: 0px; padding: 0px; line-height: 1.8; border: none; color: blue; background-color: inherit;\">&quot;/项目相对网址池绝对路径/ueditor&quot;</span><span style=\"margin: 0px; padding: 0px; line-height: 1.8; border: none; background-color: inherit;\">;&nbsp;&nbsp;</span></span></p></li><li><p><span style=\"margin: 0px; padding: 0px; line-height: 1.8; border: none; color: rgb(0, 0, 0); background-color: inherit;\">&lt;/script&gt;&nbsp;&nbsp;</span></p></li></ol><p style=\"margin: 10px auto; padding: 0px; color: rgb(51, 51, 51); font-family: verdana, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 25.200000762939453px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"margin: 0px; padding: 0px; line-height: 1.8;\">配置路径这一块是非常重要的。特别是下面的Ueditor的路径，是相对我们整个代码库的目录的。</span></p><p style=\"margin: 10px auto; padding: 0px; color: rgb(51, 51, 51); font-family: verdana, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 25.200000762939453px; white-space: normal; background-color: rgb(255, 255, 255);\">&nbsp;</p><p style=\"margin: 10px auto; padding: 0px; color: rgb(51, 51, 51); font-family: verdana, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 25.200000762939453px; white-space: normal; background-color: rgb(255, 255, 255);\">配置完成之后，直接在我们网页中的&lt;textarea&gt;标签下面添加ueditor的初始化代码：</p><p style=\"margin: 10px auto; padding: 0px; color: rgb(51, 51, 51); font-family: verdana, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 25.200000762939453px; white-space: normal; background-color: rgb(255, 255, 255);\">&nbsp;</p><p><strong style=\"margin: 0px; padding: 0px;\">[javascript]</strong>&nbsp;<a class=\"ViewSource\" title=\"view plain\" href=\"http://blog.csdn.net/killzero/article/details/16939309\" style=\"margin: 0px 10px 0px 0px; padding: 0px; text-decoration: none; color: rgb(160, 160, 160); background-image: none; background-color: inherit; border-style: none none dotted; border-bottom-width: 1px; border-bottom-color: rgb(51, 51, 51); font-size: 9px; background-position: initial initial; background-repeat: initial initial;\">view plain</a><a class=\"CopyToClipboard\" title=\"copy\" href=\"http://blog.csdn.net/killzero/article/details/16939309\" style=\"margin: 0px 10px 0px 0px; padding: 0px; text-decoration: none; color: rgb(160, 160, 160); background-image: none; background-color: inherit; border-style: none none dotted; border-bottom-width: 1px; border-bottom-color: rgb(51, 51, 51); font-size: 9px; background-position: initial initial; background-repeat: initial initial;\">copy</a><a class=\"PrintSource\" title=\"print\" href=\"http://blog.csdn.net/killzero/article/details/16939309\" style=\"margin: 0px 10px 0px 0px; padding: 0px; text-decoration: none; color: rgb(160, 160, 160); background-image: none; background-color: inherit; border-style: none none dotted; border-bottom-width: 1px; border-bottom-color: rgb(51, 51, 51); font-size: 9px; background-position: initial initial; background-repeat: initial initial;\">print</a><a class=\"About\" title=\"?\" href=\"http://blog.csdn.net/killzero/article/details/16939309\" style=\"margin: 0px 10px 0px 0px; padding: 0px; text-decoration: none; color: rgb(160, 160, 160); background-image: none; background-color: inherit; border-style: none none dotted; border-bottom-width: 1px; border-bottom-color: rgb(51, 51, 51); font-size: 9px; background-position: initial initial; background-repeat: initial initial;\">?</a><a title=\"在CODE上查看代码片\" href=\"https://code.csdn.net/snippets/80398\" target=\"_blank\" style=\"margin: 0px 10px 0px 0px; padding: 0px; text-decoration: none; color: rgb(160, 160, 160); background-image: none; background-color: inherit; border-style: none none dotted; border-bottom-width: 1px; border-bottom-color: rgb(51, 51, 51); font-size: 9px; background-position: initial initial; background-repeat: initial initial;\"><img src=\"https://code.csdn.net/assets/CODE_ico.png\" alt=\"在CODE上查看代码片\" width=\"12\" height=\"12\" style=\"margin: 0px; padding: 0px; border: 0px;\"/></a><a title=\"派生到我的代码片\" href=\"https://code.csdn.net/snippets/80398/fork\" target=\"_blank\" style=\"margin: 0px 10px 0px 0px; padding: 0px; text-decoration: none; color: rgb(160, 160, 160); background-image: none; background-color: inherit; border-style: none none dotted; border-bottom-width: 1px; border-bottom-color: rgb(51, 51, 51); font-size: 9px; background-position: initial initial; background-repeat: initial initial;\"><img src=\"https://code.csdn.net/assets/ico_fork.svg\" alt=\"派生到我的代码片\" width=\"12\" height=\"12\" style=\"margin: 0px; padding: 0px; border: 0px;\"/></a></p><ol class=\"dp-c list-paddingleft-2\" start=\"1\" style=\"padding: 0px 0px 0px 50px; border: none; list-style-position: initial; list-style-image: initial; background-color: rgb(255, 255, 255); color: rgb(92, 92, 92); margin-bottom: 1px !important; margin-left: 45px !important;\"><li><p><span style=\"margin: 0px; padding: 0px; line-height: 1.8; border: none; color: rgb(0, 0, 0); background-color: inherit;\"><span style=\"margin: 0px; padding: 0px; line-height: 1.8; border: none; background-color: inherit;\">&lt;script&nbsp;type=</span><span class=\"string\" style=\"margin: 0px; padding: 0px; line-height: 1.8; border: none; color: blue; background-color: inherit;\">&quot;text/javascript&quot;</span><span style=\"margin: 0px; padding: 0px; line-height: 1.8; border: none; background-color: inherit;\">&gt;&nbsp;&nbsp;</span></span></p></li><li><p><span style=\"margin: 0px; padding: 0px; line-height: 1.8; border: none; color: rgb(0, 0, 0); background-color: inherit;\">&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"keyword\" style=\"margin: 0px; padding: 0px; line-height: 1.8; border: none; color: rgb(0, 102, 153); background-color: inherit; font-weight: bold;\">var</span><span style=\"margin: 0px; padding: 0px; line-height: 1.8; border: none; background-color: inherit;\">&nbsp;editor&nbsp;=&nbsp;</span><span class=\"keyword\" style=\"margin: 0px; padding: 0px; line-height: 1.8; border: none; color: rgb(0, 102, 153); background-color: inherit; font-weight: bold;\">new</span><span style=\"margin: 0px; padding: 0px; line-height: 1.8; border: none; background-color: inherit;\">&nbsp;UE.ui.Editor({initialFrameHeight:100,initialFrameWidth:400&nbsp;});&nbsp;&nbsp;</span></span></p></li><li><p><span style=\"margin: 0px; padding: 0px; line-height: 1.8; border: none; color: rgb(0, 0, 0); background-color: inherit;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;editor.render(<span class=\"string\" style=\"margin: 0px; padding: 0px; line-height: 1.8; border: none; color: blue; background-color: inherit;\">&quot;actDescribe&quot;</span><span style=\"margin: 0px; padding: 0px; line-height: 1.8; border: none; background-color: inherit;\">);&nbsp;&nbsp;</span></span></p></li><li><p><span style=\"margin: 0px; padding: 0px; line-height: 1.8; border: none; color: rgb(0, 0, 0); background-color: inherit;\">&lt;/script&gt;&nbsp;&nbsp;</span></p></li></ol><p style=\"margin: 10px auto; padding: 0px; color: rgb(51, 51, 51); font-family: verdana, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 25.200000762939453px; white-space: normal; background-color: rgb(255, 255, 255);\">&nbsp;</p><p style=\"margin: 10px auto; padding: 0px; color: rgb(51, 51, 51); font-family: verdana, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 25.200000762939453px; white-space: normal; background-color: rgb(255, 255, 255);\">官方的文档并没有给出如何设置ueditor的宽度和高度的说明。这是我在网上网友那里找到的解决方法。在声明编辑器的变量的时候，在参数列表中添加对initialFrameHeight和initialFrameWidth的设置即可。注意，数值后面不需要添加px。</p><p style=\"margin: 10px auto; padding: 0px; color: rgb(51, 51, 51); font-family: verdana, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 25.200000762939453px; white-space: normal; background-color: rgb(255, 255, 255);\">&nbsp;</p><p style=\"margin: 10px auto; padding: 0px; color: rgb(51, 51, 51); font-family: verdana, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 25.200000762939453px; white-space: normal; background-color: rgb(255, 255, 255);\">&nbsp;</p><p style=\"margin: 10px auto; padding: 0px; color: rgb(51, 51, 51); font-family: verdana, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 25.200000762939453px; white-space: normal; background-color: rgb(255, 255, 255);\">可是，这种方法有时候奏效有时候也不奏效，因为我碰过一种情况就是无论如何调整initialHeight和initialWidth的数值，编辑器的大小都还是不会改变。这个时候，我发现，可以通过调整editor所跟随的textarea的宽高来撑开editor的大小。这也是一种方法，各位同学在官方说明文档出来之前可以两种方法都尝试一下。</p><p style=\"margin: 10px auto; padding: 0px; color: rgb(51, 51, 51); font-family: verdana, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 25.200000762939453px; white-space: normal; background-color: rgb(255, 255, 255);\">&nbsp;</p><p style=\"margin: 10px auto; padding: 0px; color: rgb(51, 51, 51); font-family: verdana, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 25.200000762939453px; white-space: normal; background-color: rgb(255, 255, 255);\">当然，好用的文本编辑器还是有很多的，例如kindeditor，之前准备使用这个的，而其文档方面也比较齐全，同时，整个编辑器的size也比较小，对网页的加载速度比较有利。百度的Ueditor还是有点庞大。加载时会有卡顿的速度。估计是我对底层代码的研究不够，多了很多不必要的内容。慢慢研究或许可以使得Ueditor变小。</p><p><br/></p>', '2014-05-02', '', null, null, '1', '', 'tww', null, null, '7');
